    def volumeChange(*args, **kwargs):
        volInt = volume.get()
        reverse = reversi.get()
        if reverse == False:
            for i in range(volInt):
                keyboard.tap(Key.media_volume_up)
        if reverse == True:
            for i in range(volInt):
                keyboard.tap(Key.media_volume_down)
